import React, { useState, useEffect } from 'react';
import { usePlayer } from '../context/PlayerContext';
import { motion } from 'framer-motion';
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, ResponsiveContainer } from 'recharts';
import { Book, AlignLeft, PuzzleIcon as PuzzlePiece } from 'lucide-react';
import styled from 'styled-components';

const DashboardContainer = styled.div`
  min-height: 100vh;
  width: 100%;
  height: 100vh;
  position: fixed;
  top: 0;
  left: 0;
  background: linear-gradient(to bottom right, #1a237e, #4a148c, #880e4f);
  padding: 2rem;
  color: white;
  overflow-y: auto;
  z-index: 1000;
  box-sizing: border-box;

  * {
    box-sizing: border-box;
  }

  &::-webkit-scrollbar {
    display: none;
  }

  -ms-overflow-style: none;
  scrollbar-width: none;

  @media (max-width: 768px) {
    padding: 1rem;
  }
`;

const ContentWrapper = styled.div`
  max-width: 1200px;
  margin: 0 auto;
  width: 100%;
`;

const Title = styled.h1`
  font-size: 2.5rem;
  font-weight: bold;
  margin-bottom: 2rem;
  text-align: center;

  @media (max-width: 768px) {
    font-size: 2rem;
    margin-bottom: 1.5rem;
  }

  @media (max-width: 480px) {
    font-size: 1.75rem;
    margin-bottom: 1rem;
  }
`;

const TabContainer = styled.div`
  display: flex;
  justify-content: center;
  gap: 1rem;
  margin-bottom: 2rem;
`;

const TabButton = styled.button`
  padding: 0.8rem 1.5rem;
  border: 2px solid white;
  border-radius: 8px;
  background: ${props => props.active ? 'white' : 'transparent'};
  color: ${props => props.active ? '#4a148c' : 'white'};
  cursor: pointer;
  transition: all 0.3s ease;

  &:hover {
    background: ${props => props.active ? 'white' : 'rgba(255, 255, 255, 0.1)'};
  }
`;

const StatsContainer = styled.div`
  display: flex;
  justify-content: center;
  gap: 2rem;
  flex-wrap: wrap;
`;

const StatCard = styled.div`
  background: rgba(255, 255, 255, 0.1);
  padding: 2rem;
  border-radius: 10px;
  text-align: center;
  min-width: 200px;
`;

const StatValue = styled.div`
  color: white;
  font-size: 2.5rem;
  font-weight: bold;
  margin-bottom: 0.5rem;
`;

const StatLabel = styled.div`
  color: white;
  font-size: 1rem;
`;

const Dashboard = () => {
  const { playerName, gameProgress } = usePlayer();
  const [activeTab, setActiveTab] = useState('tasks');

  return (
    <DashboardContainer>
      <ContentWrapper>
        <Title>მოგესალმები, {playerName}! 👋</Title>

        <TabContainer>
          <TabButton 
            active={activeTab === 'tasks'} 
            onClick={() => setActiveTab('tasks')}
          >
            სახალისო ამოცანები
          </TabButton>
          <TabButton 
            active={activeTab === 'scramble'} 
            onClick={() => setActiveTab('scramble')}
          >
            ასოების თამაში
          </TabButton>
          <TabButton 
            active={activeTab === 'puzzles'} 
            onClick={() => setActiveTab('puzzles')}
          >
            პაზლები
          </TabButton>
        </TabContainer>

        {activeTab === 'tasks' && (
          <StatsContainer>
            <StatCard>
              <StatValue>{gameProgress.completedTasks?.length || 0}</StatValue>
              <StatLabel>დასრულებული ამოცანები</StatLabel>
            </StatCard>
          </StatsContainer>
        )}

        {activeTab === 'scramble' && (
          <StatsContainer>
            <StatCard>
              <StatValue>{gameProgress.completedScrambleTasks?.length || 0}</StatValue>
              <StatLabel>დასრულებული თამაშები</StatLabel>
            </StatCard>
          </StatsContainer>
        )}

        {activeTab === 'puzzles' && (
          <StatsContainer>
            <StatCard>
              <StatValue>{gameProgress.puzzles?.length || 0}</StatValue>
              <StatLabel>დასრულებული პაზლები</StatLabel>
            </StatCard>
          </StatsContainer>
        )}
      </ContentWrapper>
    </DashboardContainer>
  );
};

export default Dashboard;
